const ProjectItem = ({ project }) => {
	return (
		<tr>
			<td>
				{projet.name}
			</td>
			<td>
				{project.url}
			</td>
			<td>
				{project.is_active}
			</td>
		</tr>
	)
}

const ProjectsList = ({ projects }) => {
	if (Object.keys(projects).length != 0) {
		return (
			<div>
				{projects.results.map((project) => <ProjectItem project={project}/> )}
			</div>
		)
	}
	return(
			<p>data none</p>
	)
}

export default ProjectsList;
